import React from 'react'
import { Col } from 'reactstrap'

const TRow = ({ 
    index,
    id,
    name,
    email,
    contactNo,
    dob,
    role
 }) => {
    return (
        <div key={id} className='b-bottom-gray table__item bg-white'>
        {/* <div className='d-flex align-items-center flex-nowrap table__row'> */}
          <Col className="table__col">{index}</Col>
          <Col className="table__col d-none d-lg-flex">{name || '-'}</Col>
          <Col className="table__col d-none d-lg-flex">{email || '-'}</Col>
          <Col className="table__col">{contactNo || '-'}</Col>
          <Col className="table__col d-none d-lg-flex">{dob || '-'}</Col>
          <Col className="table__col d-none d-lg-flex">{role || '-'}</Col>
          {/* </div> */}
      </div>
    )
}

export default TRow
